def test_converts_basic_generator(converter):
    value = ''':::QR
title
content
:::'''
    result = '<img src="data:image/svg+xml;base64," alt="None" height="250" width="250" style="width:250px;height:250px;">'
    assert converter(value) == result


def test_converts_shortened_generator(converter):
    value = ''':::QR`title`content`:::'''
    result = '<img src="data:image/svg+xml;base64," alt="None" height="250" width="250" style="width:250px;height:250px;">'
    assert converter(value) == result



def test_converts_yaml(converter):
    value = '''```barcode
title: for the image
data: http://www.data-to.encode
reference: Not implemented
height: 400
width: 400
```'''
    result = '<img src="data:image/svg+xml;base64," alt="for the image" height="400" width="400" style="width:400px;height:400px;">'
    assert converter(value) == result


def test_converts_yaml_no_size(converter):
    value = '''```barcode
title: for the image
data: http://www.data-to.encode
reference: Not implemented
```'''
    result = '<img src="data:image/svg+xml;base64," alt="for the image" height="250" width="250" style="width:250px;height:250px;">'
    assert converter(value) == result


def test_missing_data(converter):
    value = '''```barcode
title: for the image
data: 
reference: Not implemented
height: 400
width: 400
```'''
    result = '<b>Missing value: Missing data</b>'
    assert converter(value) == result
